import time
import numpy as np
from dbmind.common.types.sequence import Sequence
from dbmind.common.algorithm.forecasting.forcasting_algorithm import quickly_forecast, \
    sequence_interpolate
from dbmind.common.algorithm.statistics import trim_head_and_tail_nan


def do_arima_forecast_show(origin_data, forecast_and_history_data, p=0, d=0, q=0):
    try:
        import matplotlib.pyplot as plt
        fig = plt.figure(figsize=(16, 9))
        ax1 = fig.add_subplot(311)

        # forecast_data/data
        ax1.plot(forecast_and_history_data, color="red", linestyle='--',
                 label="forecast_data:(p:%s, d:%s, q:%s)"
                       % (p, d, q))
        ax1.plot(origin_data, label="raw_data")
        ax1.legend()
        plt.show()
    except Exception:
        pass


def test_arima_for_linear():
    data = DATA[2000:5000]
    data = list(range(3000))
    train_length = 2100
    forecast_length = 900
    train_data = data[:train_length]
    s = Sequence(timestamps=list(range(len(data[:train_length]))), values=train_data, step=1000)
    forecasting_minutes = forecast_length * s.step // (60 * 1000)
    forecast_sequence = quickly_forecast(sequence=s, forecasting_minutes=forecasting_minutes)
    do_arima_forecast_show(origin_data=data[:forecast_length + train_length],
                           forecast_and_history_data=list(data[:train_length]) + list(forecast_sequence.values))
    assert True


