def test_sequence_interpolate():
    start_time_array = time.strptime("2021-12-20 00:00:00", "%Y-%m-%d %H:%M:%S")
    start_timestamp = int(time.mktime(start_time_array)) * 1000
    interval = 60 * 1000
    head_nan_data = [np.nan, np.nan,  np.nan, np.nan] + list(range(1, 100))
    tail_nan_data = list(range(1, 100)) + [np.nan, np.nan, np.nan, np.nan]
    head_tail_nan_data = head_nan_data + tail_nan_data
    all_nan_data = [np.nan] * 100
    internal_nan_data = head_nan_data + [np.nan] * 10 + tail_nan_data
    invalid_data = [all_nan_data, ]
    test_data = [head_nan_data, tail_nan_data, head_tail_nan_data, all_nan_data, internal_nan_data]
    except_count = 0
    for t_data in test_data:
        try:
            timestamps = [start_timestamp + interval * (i + 1) for i in range(len(t_data))]
            s = Sequence(timestamps=timestamps, values=t_data)
            s_new = sequence_interpolate(s)
            not_exist_nan = all([True if not np.isnan(i) else False for i in s_new.values])
            assert not_exist_nan

        except Exception:
            except_count += 1
            continue
    assert except_count == len(invalid_data)


def test_trim_head_and_tail_nan():
    test_data = [np.nan, 1, 2, 3, np.nan]
    trim_data = trim_head_and_tail_nan(test_data)
    assert trim_data[0] != np.nan
    assert trim_data[-1] != np.nan
    test_data = []
    trim_data = trim_head_and_tail_nan(test_data)
    assert len(trim_data) == 0

    test_data = [np.nan, np.nan, np.nan]
    trim_data = trim_head_and_tail_nan(test_data)
    assert len(trim_data) == len(test_data)
    assert len(trim_data) != 0
    assert trim_data[0] == 0
    assert trim_data[-1] == 0
